import React from "react";
import btn from "./assets/button.png";
import "./style.css";

function Button() {
  return (
    <div className="button">
      <p className="header">Time Records</p>
      <div>
        <div className={classes.root}>
          <Button variant="contained" color="#2e5bff">
            <img src={btn} alt="btn" />
            Add New
          </Button>
        </div>
        {/* <button className="btn">
          <img src={btn} alt="btn" /> Add New
        </button> */}
      </div>
    </div>
  );
}

export default Button;
